import React, {useEffect, useState} from "react";
import './apartments.css';

function EditApartments() {

    return (
        <div>
            <h2>Add Advertisement</h2>
            <table>
                <tbody>
                    <tr>
                        <th>Type</th>
                        <th>Rent\Sell</th>
                        <th>Size</th>
                        <th>Rooms</th>
                        <th>Price</th>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}
export default EditApartments;
